import { NavLink } from "react-router-dom";
import "./Menu.css";

function Menu(): JSX.Element {
    return (
        <div className="Menu">

            <NavLink to="/home">Home</NavLink>
            <span> | </span>
            <NavLink to="/list">List</NavLink>
            <span> | </span>
            <NavLink to="/add">Add</NavLink>
            <span> | </span>
            <NavLink to="/search">search movie</NavLink>
            <span></span>

        </div>
    );
}

export default Menu;
